import React from "react";
import styled from "styled-components";

const Container = () => {
  const Container = styled.div`
    background-color: white;
    position: relative;
    left: 35%;
    width: 65%;
    height: 100%;
  `;
  return (
    <>
      <Container></Container>
    </>
  );
};

export default Container;
